import React from 'react';
import AddTodo from './AddTodo';

function Header(props){ //We need to mention "props" as a parameter as we intend to use props passed by the parent component in this functional class.
    return(
        <header>
            <nav class="nav-extended">
                <div className="nav-wrapper">
                    <a href="#" className="brand-logo center">ToDo List</a>
                    <AddTodo addTodo={props.addTodo} />
                </div>
                <div class="nav-content">
                    <ul class="tabs tabs-transparent">
                        <li class="tab"><a href="#test1">Tasks</a></li>
                        <li class="tab"><a class="active" href="#test2">About</a></li>
                    </ul>
                </div>
            </nav>
        </header>    
    );
}

export default Header;
